import React from 'react'
import { useSelector, useDispatch } from 'react-redux'
import { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'
import { loginActions } from '../store/storeLogin';
import { theme } from '../index';
import { Grid, Paper } from '@mui/material';
import { ThemeProvider } from '@mui/material/styles';
import { Button } from '@mui/material';
import ResponsiveAppBar from './homeComponents/ResponsiveAppBar';
import FormularioProducto from './homeComponents/FormularioProducto';

// Borja Vega Suárez

function Home() {

    const userData = useSelector(state => state.login)
    const navigate = useNavigate()
    const dispatch = useDispatch();


    const isLoggedin = userData.isAutenticated

    useEffect(() => {  // Comprobar si el usuario esta autenticado
        if (!isLoggedin) {
            navigate('/login')
        }
    }, [isLoggedin, navigate])

    // Logout
    const handleLogout = () => {
        dispatch(loginActions.logout());
        navigate('/login');
    }
    // Comprobamos por consola qué obtenemos en userData
    console.log(userData)

    return (
        <ThemeProvider theme={theme}>
            <ResponsiveAppBar />
            <>
                <Grid
                    container
                    justifyContent="center"
                    alignItems="center"
                    className="home-container"
                >
                    <FormularioProducto />
                </Grid>
            </>
        </ThemeProvider>
    )};
